import React from 'react';
import styles from "./Contact.module.css"

function Contact() {
  return (
    <div id="contact" className={styles.contact}> 
      <div>Contact</div>
      <div>感谢关注！ 任何资讯欢迎随时联系。
        zhangshangdong888855@gmail.com</div>
      <div>若搜尋Mugino12138添加本人微信</div>
    </div>
  );
}

export default Contact;
